import React, { Component } from 'react';

class AssidBar extends Component {
  render() {
    return (
      <div>
        <div className='position-fixed top-50 start-0 bg-info'>
          AssidBar
        </div>
        <div className='position-fixed bottom-0 end-0 bg-info'><i class="bi bi-arrow-up-circle h1"></i></div>
      </div>
    );
  }
}

export default AssidBar;
